/**
 * 判断用户名是否是规定格式,如果是返回特定字符串，否返回原有字符串
 * @param type $username 用户名 
 * @return $username 
 */
function is_username_number($username){
    
    if(is_numeric($username)){
        $username = substr_replace($username,'****',3,4);
    }
    if(is_email($username)){
        $username = substr_replace($username,'****',0,4);
    }
    
    return $username;
}

/**
 * 判断某个字符串是否是邮箱格式
 * @param type $email
 * @return type 
 */
function is_email($email){
    return strlen($email) > 6 && preg_match("/^[\w\-\.]+@[\w\-]+(\.\w+)+$/",$email);
}

